cy.visit('http://www.webdriveruniversity.com/'); //scrollIntoView untuk mengarahkan view sesuai dengan scroll yang ditujunya.
cy.get('#datepicker').scrollIntoView().invoke('removeAttr', 'target').click({
  force: true
});
cy.get('#datepicker').click();
var date = new Date();
date.setDate(date.getDate() + 1);
var day = date.getDate();
var month = date.toLocaleString('default', {
  month: 'long'
});
var year = date.getFullYear();
cy.log(day);
cy.log(month);
cy.log(year);
function selectDay() {
  cy.get('.day').contains(day).click();
}
function selectMonthAndYear() {
  cy.get('.datepicker-switch').first().then(function (dateYears) {
    var dateYear = dateYears.text();
    if (!dateYear.includes(year)) {
      cy.get('.next').first().click();
    }
  }).then(function () {
    cy.get('.datepicker-switch').first().then(function (dateMonths) {
      var dateMonth = dateMonths.text();
      if (!dateMonth.includes(month)) {
        cy.get('.next').first().click();
        return selectMonthAndYear();
      }
    });
  });
}
selectMonthAndYear();
selectDay();

